// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./TipoEnergia.sol";
import "../libraries/StringLibrary.sol";

contract TipoEnergiaFactory {
    using StringLibrary for string;

    function generarNuevaEnergia(
        string memory nombreTipoEnergia,
        uint256 _cantidadEnergia
    ) public returns (TipoEnergia) {
        TipoEnergia tempTipoEnergia;
        bool flag = false;
        if (nombreTipoEnergia.equals("solar")) {
            tempTipoEnergia = new EnergiaSolar("solar", _cantidadEnergia);
            flag = true;
        } else if (nombreTipoEnergia.equals("eolica")) {
            tempTipoEnergia = new EnergiaEolica("eolica", _cantidadEnergia);
            flag = true;
        } else if (nombreTipoEnergia.equals("hidraulica")) {
            tempTipoEnergia = new EnergiaHidraulica(
                "hidraulica",
                _cantidadEnergia
            );
            flag = true;
        }
        require(
            flag,
            "No es un tipo de energia valido, los tipos validos son: solar, eolica o hidraulica"
        );
        return tempTipoEnergia;
    }
}
